import com.databricks.spark.corenlp.CoreNLP

// Details on the CoreNLP are here:
//   https://github.com/databricks/spark-corenlp

// Split each document into words
val coreNLPTokenizer = new CoreNLP()
  .setInputCol("description")
  .setOutputCol("words")
  .setAnnotators(Array("tokenize", "ssplit", "pos", "ner"))
  .setFlattenNestedFields(Array("sentence_token_word"))

z.show(coreNLPTokenizer.transform(itemsDF))

import org.apache.spark.ml.feature.StopWordsRemover

// Filter out stopwords
// The following list will be used by default if we don't specify a list:  
//   http://ir.dcs.gla.ac.uk/resources/linguistic_utils/stop_words
val stopWordsFilter = new StopWordsRemover()
  .setInputCol(coreNLPTokenizer.getOutputCol)
  .setOutputCol("filteredWords")
  .setCaseSensitive(false)

